import React from 'react';
import './Profile.css'

const Profile = props => {
    return ( 
        <div className="">
            <img className="profile-image" src={props.imgURL} alt=""/>
            <div class="profile-title">

            </div>
        </div>
     );
}
 
export default Profile;
